// Imports
import { Outlet } from "react-router-dom";
import { Container, Header, Link } from "./App.styled";

export const SharedLayout = () => {
	return (
		<Container>
			<Header>
				<nav>
					<Link to="/" end>Home</Link>
					<Link to="/movies">Movies</Link>
				</nav>
			</Header>
			<Outlet />
		</Container>
	);
};
